  return (
    <div className="h-screen flex items-center justify-center bg-background">
      <div className="text-black text-center">
        <h1 className="text-4xl font-bold mb-4">Bem-vindo à Página Inicial</h1>
      </div>
    </div>
  );
};

export default Home;
